CREATE TABLE IF NOT EXISTS progresostable(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    peso TEXT, 
    masa_muscular TEXT,
    foto TEXT
);

CREATE TABLE IF NOT EXISTS registroTable(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    nombre TEXT, 
    genero TEXT,
    estatura TEXT,
    peso TEXT
);
